import React, { useState } from 'react';

export default function Search() {
   const [search, setSearch] = useState('');

   return (
      <>
         <input
            type="text"
            placeholder="Search..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
         />
         <AirPods search={search} />
         <AppleCore search={search} />
         <Cart search={search} />
         <Hearts search={search} />
         <IMac search={search} />
         <IPad search={search} />
         <IPhone search={search} />
         <Mac search={search} />
         <MacBook search={search} />
         <Price search={search} />
         <TVandHome search={search} />
         <Watch search={search} />
      </>
   );
}
